export const myCss = {
  gridItem: {
    border: "1px solid purple",
    borderRight: "hidden",
    borderLeft: "hidden",
    position:"relative",
  },
  paperDate: {
    width: "3rem",
    marginLeft: "2rem",
    marginBottom: "1rem",
    marginTop: "1rem",
    borderRadius: "9px",
  },
  typoDate: {
    fontSize: "5rem",
    marginLeft: "1.5rem",
    marginTop: "-10px",
    marginBottom: "-10px",
  },
  paperMonthAndDay: {
    width: "4rem",
    marginBottom: "1rem",
    marginTop: "1rem",
    borderRadius: "9px",
    fontSize: "2rem",
  },
  typoMonth: {
    fontSize: "1rem",    
  },
  typoDay: {
    fontSize: "1rem",
  },
  typoWeek: {
    fontSize: "1rem",
    marginTop: "7px",
  },
  typoWeekNr: {
    fontSize: "2rem",
    marginTop: "8px",
    padding: "0px",
  },
  calContainer: {
    border: "1px solid blue",
  },
  calDisplayM: {
    display: "inline",
  },
  calDisplay: {
    display: "inline",
  },
};
